import React, { Component } from 'react';
import './App.css';
import Menu from '../../Containers/Menu/Menu';
import { Route, BrowserRouter } from 'react-router-dom'
import CocktailContainer from '../../Components/CocktailContainer/CocktailContainer';
import PartyContainer from '../../Components/PartyContainer/PartyContainer';

export class App extends Component {
  constructor() {
    super();
    this.state = {
      parties: []
    }
  }

  componentDidMount() {

  }

  setPartyName = (party) => {
    this.state.parties.push({party: [party]})
  }

  render() {
    return (
      <div className='App'>
        <Menu />
        <BrowserRouter>
          <Route
            path='/cocktails'
            render={props => (
          <CocktailContainer />
          )}>
          </Route>
          <Route
            path='/parties'
            render={props => (
          <PartyContainer />
          )}>
          </Route>
        </BrowserRouter>
      </div>
  );
}

}

export default App;
